import React, { useState } from 'react';
import './AccountPage.css';

const AccountPage = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    company: '',
    jobTitle: '',
    industry: '',
    yearsExperience: '',
    skills: '',
    linkedinUrl: '',
    bio: ''
  });
  const [isEditing, setIsEditing] = useState(true); // Start in edit mode

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Just show the data in console (not saving to database)
    console.log('Form data:', formData);
    setIsEditing(false);
  };

  return (
    <div className="account-container">
      <h1>Professional Profile</h1>
      <p>Enter your work information below</p>

      <form onSubmit={handleSubmit} className="account-form">
        <div className="form-section">
          <h2>Personal Information</h2>
          <div className="form-row">
            <div className="form-group">
              <label>First Name</label>
              <input
                type="text"
                name="firstName"
                value={formData.firstName}
                onChange={handleChange}
                disabled={!isEditing}
              />
            </div>
            <div className="form-group">
              <label>Last Name</label>
              <input
                type="text"
                name="lastName"
                value={formData.lastName}
                onChange={handleChange}
                disabled={!isEditing}
              />
            </div>
          </div>
          <div className="form-group">
            <label>Email</label>
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              disabled={!isEditing}
            />
          </div>
        </div>

        <div className="form-section">
          <h2>Work Information</h2>
          <div className="form-row">
            <div className="form-group">
              <label>Company</label>
              <input
                type="text"
                name="company"
                value={formData.company}
                onChange={handleChange}
                disabled={!isEditing}
              />
            </div>
            <div className="form-group">
              <label>Job Title</label>
              <input
                type="text"
                name="jobTitle"
                value={formData.jobTitle}
                onChange={handleChange}
                disabled={!isEditing}
              />
            </div>
          </div>
          <div className="form-group">
            <label>Skills (comma separated)</label>
            <input
              type="text"
              name="skills"
              value={formData.skills}
              onChange={handleChange}
              disabled={!isEditing}
              placeholder="React, JavaScript, Project Management"
            />
          </div>
        </div>

        <div className="form-section">
          <h2>Professional Links</h2>
          <div className="form-group">
            <label>LinkedIn Profile URL</label>
            <input
              type="url"
              name="linkedinUrl"
              value={formData.linkedinUrl}
              onChange={handleChange}
              disabled={!isEditing}
              placeholder="https://linkedin.com/in/yourprofile"
            />
          </div>
        </div>

        {isEditing ? (
          <div className="form-actions">
            <button type="submit" className="save-btn">
              Save Information
            </button>
          </div>
        ) : (
          <div className="form-actions">
            <button 
              type="button" 
              onClick={() => setIsEditing(true)}
              className="edit-btn"
            >
              Edit Information
            </button>
          </div>
        )}
      </form>

      {formData.linkedinUrl && (
        <div className="linkedin-preview">
          <h3>Your LinkedIn Profile</h3>
          <div className="preview-container">
            <a href={formData.linkedinUrl} target="_blank" rel="noopener noreferrer">
              {formData.linkedinUrl}
            </a>
          </div>
        </div>
      )}
    </div>
  );
};

export default AccountPage;
